import React from 'react';
import { Link } from 'react-router-dom';

const Subscribe = () => {
    return (
        <div className="footer__section__container__subscribe">
            <h1>Subscribe Now</h1>
            <p>Lorem ipsum dolor sit amet consectetur.</p>
            <form>
                <div className="footer__section__container__subscribe__form">
                    <input type="text" className="footer__section__container__subscribe__form--input" />
                    <button>Subscribe</button>
                </div>
            </form>
            <div className="footer__section__container__footer__subscribe__cosial-links">
                <Link to='/'>
                    <i className="fa fa-facebook"></i>
                </Link>
                <Link to='/'>
                    <i className="fa fa-twitter"></i>
                </Link>
                <Link to='/'>
                    <i className="fa fa-linkedin"></i>
                </Link>
            </div>
        </div>
    );
};

export default Subscribe;
